return(

    <Card className = 'product-item'>
        <ItemDate date={props.date}> </ItemDate>
        <div className='product-item-desc'></div>
        <h2> {props.title}</h2>
        <div>
            <button onClick={clickHand}> Add to Cart</button>
        </div>

    </Card>
)

}

export default ProductItem;
